import React from "react";
import Header from "./Components/Header/Header";
import SocialMedia from "./Components/SocialMedia/SocialMedia";
import WhiteWave from "./Components/White Wave/WhiteWave";
import About from "./Components/About/About";
import Brunch from "./Components/Brunch/Brunch";
import Keiterings from "./Components/Keiterings/Keiterings";
import Reservation from "./Components/Reservation/Reservation";
import Gallery from "./Components/Gallery/Gallery";
import WhiteWaveBottom from "./Components/WhiteWaveBottom/WhiteWaveBottom";
import Footer from "./Components/Footer/Footer";

const Eng = () => {
  return (
    <div>
      <Header
        about="About us"
        brunch="Brunch"
        menu="Menu"
        banquet="Banquets"
        contacts="Contacts"
        welcome="Welcome to"
        reserve="Make a reservation"
      />
      <SocialMedia />
      <WhiteWave />
      <About lang="eng" />
      <Brunch lang="eng" />
      <Keiterings lang="eng" />
      <Reservation lang="eng" />
      <Gallery />
      <WhiteWaveBottom />
      <Footer lang="eng" />
    </div>
  );
};
export default Eng;
